import React, { Component } from "react";
import "./styles.scss";

class Home extends Component {
  render() {
    return (
      <table className="table">
        <thead>
          <tr>
            <th>STT</th>
            <th>Image</th>
            <th>Name Product</th>
            <th>Status</th>
            <th>Actions</th>
          </tr>
        </thead>
      </table>
    );
  }
}

export default Home;
